import React from "react";
import Games from "./components/Games";
import Header from "./components/Header";
import Stats from "./components/Stats";
import Users from "./components/Users";

const Home = () => {
  return (
    <div>
      <Header />
      <main>
        <Users />
        <Games />
        <Stats />
      </main>
    </div>
  );
};

export default Home;
